import PropTypes from 'prop-types';
import styles from './CompletionPage.module.css';
import React, { useState, Component, useContext } from 'react';
import { Row } from 'react-bootstrap';
import Col from 'react-bootstrap/Col';
import AppContext from '../AppContext/AppContext';

const CompletionPage = () => {
  const myContext = useContext(AppContext);
  console.log("intro: "+myContext.options);
  return (
    <div>
      <Row>
        <Col>
          <h2>Name:</h2>
          <h3>{myContext.name}</h3></Col>
      </Row>
      <Row>
        <Col>
          <h2>Date:</h2>
          <h3>{myContext.month} / {myContext.day} / {myContext.year}</h3>
        </Col>
      </Row>
      <Row>
        <Col>
          <h2>Selected:</h2>
          {(() => {
            let opts = []
            for(var i=0; i < myContext.options.length; i++) {
              opts.push(
                <h3>
                  i  myContext.options[i];
                </h3>
              )
            }
            return opts;
          })()}
        </Col>
      </Row>
    </div>
  );
}

export default CompletionPage;
